import React, { useState, useEffect } from "react";
import { Button, Container, Toast, Table, Row, Col } from "react-bootstrap";
import axios from "axios";
import AjoutVille from "./AjoutVille";
import "./ville.css";

const Villes = () => {
  const [villes, setVilles] = useState([]);
  const [showForm, setShowForm] = useState(false);
  const [showToast, setShowToast] = useState(false);
  const [selectedVilleId, setSelectedVilleId] = useState(null);

  useEffect(() => {
    fetchVilles();
  }, []);

  const fetchVilles = async () => {
    try {
      const response = await axios.get("http://localhost:8082/api/ville");
      setVilles(response.data);
    } catch (error) {
      console.error("Error fetching villes:", error);
    }
  };

  const handleDeleteClick = (villeId) => {
    setSelectedVilleId(villeId);
    setShowToast(true);
  };

  const confirmDeletion = async () => {
    try {
      await axios.delete(`http://localhost:8082/api/ville/${selectedVilleId}`);
      setVilles((currentVilles) =>
        currentVilles.filter((ville) => ville.id !== selectedVilleId)
      );
      setShowToast(false);
      setSelectedVilleId(null);
    } catch (error) {
      console.error("Error deleting ville:", error);
      setShowToast(false);
    }
  };

  const addVille = async (villeName, region) => {
    try {
      const response = await axios.post("http://localhost:8082/api/ville", {
        name: villeName,
        region: region,
      });
      fetchVilles(); // Refresh the list of cities
    } catch (error) {
      console.error("Error adding ville:", error);
    }
  };

  return (
    <Container>
      <div className="py-4">
        <h2 className="text-center my-4">Gestion des Villes</h2>
        <Button
          className="btn-primary-custom mb-4 my-3"
          onClick={() => setShowForm(true)}
        >
          Ajouter Ville
        </Button>
        {showForm && (
          <AjoutVille
            onAddVille={addVille}
            onClose={() => setShowForm(false)}
          />
        )}
        <Row className="justify-content-center">
          <Col xs={12} md={8}>
            <Table bordered hover className="custom-table">
              <thead>
                <tr>
                  <th>Id</th>
                  <th>Nom de la ville</th>
                  <th>Région</th>
                  <th>Action</th>
                </tr>
              </thead>
              <tbody>
                {villes.map((ville) => (
                  <tr key={ville.id}>
                    <td>{ville.id}</td>
                    <td>{ville.name}</td>
                    <td>{ville.region}</td>
                    <td className="align-middle">
                      <Button
                        variant="danger"
                        onClick={() => handleDeleteClick(ville.id)}
                      >
                        Supprimer
                      </Button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </Table>
          </Col>
        </Row>
        {showToast && (
          <Toast
            onClose={() => setShowToast(false)}
            show={showToast}
            className="custom-toast-style"
            bg="light"
          >
            <Toast.Body>
              Êtes-vous sûr de vouloir supprimer cette ville ?
              <div className="mt-2 d-flex justify-content-between">
                <Button variant="danger" onClick={confirmDeletion}>
                  Confirmer
                </Button>
                <Button variant="secondary" onClick={() => setShowToast(false)}>
                  Annuler
                </Button>
              </div>
            </Toast.Body>
          </Toast>
        )}
      </div>
    </Container>
  );
};

export default Villes;
